import QuanLyDatVeServ from "../../services/QuanLyDatVe.service";

export const layChiTietPhongVeAction = (maLichChieu) => {
  return (dispatch) => {
    QuanLyDatVeServ.layChiTietPhongVe(maLichChieu)
      .then((res) => {
        console.log("res", res);
      })
      .catch((err) => {
        console.log("err", err);
      });
  };
};
